import React from "react";
import logo from "./logo.svg";
import App from "./App";
export default function Navbar() {
  return (
    <nav>
      <img src={logo} className="App-logo" alt="logo" /> 
      <h1>ReactFacts </h1>
      <p>React </p>
    </nav>
  );
}
